import React from "react";
import SimpleNavbar from "./SimpleNavbar";
export default function Service() {
  return (
    <div>
    <SimpleNavbar />
      <h1>Our Services</h1>
      <p>We offer dine-in, takeout, and delivery services for your favorite coffee and pastries.</p>
      <p>Special offers are available for bulk orders and events!</p>
    </div>
  );
}
